function int(name, type) {
	var intert = name;
	var inttype = type;
	}
function action(intert, src) {
	if(inttype == "intert.url"){
		window.location.href = "https://" + src;
		}
	if(inttype == "intert.view"){
		window.location.href = src;
		}
	if(inttype == "intert.call"){
		window.location.href = "call:" + src;
		}
		}
